@-moz-document url-prefix("https://tadah.rocks/forum"), url-prefix("https://tadah.rocks/servers") {
.navbar {
    background-image: url(https://archive.fo/0RAE1/ceb3913ed184fa77eb6f854889164f66c44d0f98.png);
    width: 900px;
    font-family: Arial, Helvetica, sans-serif;
    font-size: 12pt;
    margin-left: 500px;
    font-weight: bold;
    height: 30px;
}

.navbar-second {
    width: 900px;
    height: 30px;
    background-image: url(https://cdn.discordapp.com/attachments/559417404522758178/889249017605787718/ab614a76c7161900a7bc6c5e676c39eebd396c78.png);
    font-family: Arial, Helvetica, sans-serif;
    margin-left: 500px;
    font-weight: bold;
    font-size: 11pt;
}



.fa, .fab, .fad, .fal, .far, .fas {
    display:none !important;
    -moz-osx-font-smoothing: grayscale;
    -webkit-font-smoothing: antialiased;
    display: inline-block;
    font-style: normal;
    font-variant: normal;
    text-rendering: auto;
    line-height: 1;
}

hr {
    display:none !important;
    border: 0;
    border-top: 1px solid rgba(0,0,0,.1);
    margin-bottom: 1rem;
    margin-top: 1rem;
}



.alert-warning {
    display:none !important;
    background-color: #f9c840;
    border-color: #facd52;
    color: #fef2d2;
}

.navbar-nav {
    display: flex;
    flex-direction: column;
    list-style: none;
    margin-bottom: 0;
    padding-left: 15rem;
}

.navbar-brand {
    display:none !important;
    font-size: 0.1rem;
    line-height: inherit;
    margin-right: 15rem;
    white-space: nowrap;
    
}


body:before {
    content: url(https://cdn.discordapp.com/attachments/523625108850343959/948320088455536670/TadahBanner.jpg);
    width: 900px;
    height: 190px;
    margin: 500px;
    background-color: transparent;
}
body {
    background-image: url(https://archive.fo/0RAE1/a356930f2834772abc7bcdab1d19522039c0ff59.jpg);
    background-repeat: repeat-x;
    background-size: auto auto;
    background-position: 50% 0%;
    text-align: left;
    overflow-x: auto;
    overflow-y: auto;
    background-color: rgb(0, 4, 68);
    FONT-SIZE: 8pt;
    COLOR: #000000;
    FONT-FAMILY: Verdana, Arial, Helvetica, sans-serif;

}

.app {
    flex: 1;
    width: 900px;
        background-image: url(https://archive.ph/0RAE1/12c1bd668716cfb46c239cfe99e1b8de10458814.png);
    background-repeat: repeat;
    background-color: rgba(0, 4, 67, 1.0);
}





.games-container {
    padding: 30px;
        background: url(https://cdn.discordapp.com/attachments/559417404522758178/888847131388022794/standardBox_01_bkg1.png) top repeat-x #fff;
    border: 1px solid #aaa;
    margin-right: 1px;
    margin-left: 1px;
}


.navbar-nav:nth-child(2) {

    position: absolute;
    background: url(https://cdn.discordapp.com/attachments/523625108850343959/950569275876319302/fixingthisfinally.png) top repeat-x #fff;
    top: -150px;
    right: 30px;
    height: 60px;
    border: 1px solid #aaa;
    padding: 6px;
    color: #000;
    font-family: Source Sans Pro,sans-serif;
    font-size: .9rem;
    font-weight: 400;
    line-height: 1.6;
    margin: 0;
    text-align: left;
}

.navbar-dark .navbar-text {
    color: hsl(0deg 0% 0%);
    font-weight: bold;
}

.dropdown, .dropleft, .dropright, .dropup {
    position: relative;
    color: hsl(0deg 0% 0%);
    font-weight: bold;
}

.navbar-dark .navbar-nav .nav-link {
    color: hsl(0deg 0% 100%);
}

.text-light {
    color: #000000!important;
}

[role=button] {
    cursor: pointer;
    color: #000000!important;
}


.btn-outline-light {
    color: #000000;
    border-color: #00000000;
}

.btn-outline-light:hover {
    color: #000000;
    border-color: #00000000;
}


.fa-pizza-slice:before {
    content: "R$:";

        color: Green;
    font-weight: bold;
    font-family: Verdana,Sans-Serif;
}

a.btn.btn-sm.btn-outline-light.my-1.mr-2:nth-child(3) {
        color: Green;
    font-weight: bold;
    font-family: Verdana,Sans-Serif;
}

a.nav-link.mr-2 {
    position: absolute;
    right: 790px;
    top: -25px;
    background-image: url(https://archive.fo/0RAE1/ceb3913ed184fa77eb6f854889164f66c44d0f98.png);
    height:29px;
    border-radius: 3px;
        border: 1px solid #aaa;
        
}


.alert.py-2.mb-0.rounded-0.text-center.text-light {
    background-color: #FFF;
    text-align: center;
    color: #FFF;
    border: 2px solid #000;
    padding: 1px;
    width: 900px;
    margin: auto;
}

.alert p {
    margin-bottom: 0;
    color: white;
    font-weight: 1000;
}

.footer-dark {
    background-color: #e6e6e6;
    color: #aaa;
}

.badge-success {
    background-image: url(https://cdn.discordapp.com/attachments/523625108850343959/950504621917483059/onlinee.png);
}

.badge-secondary {
    background-image: url(https://cdn.discordapp.com/attachments/523625108850343959/950505249997750343/hjted.png);
}

.badge-primary {
