}

.pb-4, .py-4 {
    background-color: #fff;
    width: 900px;
    margin-left: 500px;
    background-image: url(https://web.archive.org/web/20110312012735im_/http://www.roblox.com/css/rbx2/images/containerBkg_01.png);
}

.card-body {
    border: 1px solid #aaa;
}

.btn-primary {
    background-color: #435D77;
    border-color: #007001;
    color: #fff;
    font-weight: bold;
    background-image: url(https://cdn.discordapp.com/attachments/523625108850343959/950846267616002098/btn_suyccjess1.png);background-color: #007001;
}

.btn-success {
    background-color: #007001;
    border-color: #007001;
    color: #fff;
    top: -8px;
    font-weight: bold;
    background-image: url(https://cdn.discordapp.com/attachments/523625108850343959/950724270600912896/btn_success.png);background-color: #007001;
}

tr {
    background-color: #fff;
}

.mb-md-0, .my-md-0 {
    margin-bottom: 0!important;
    left: -200px;
    height: 350px;
    background-color: #fff;
}


.alert-danger {
    background-color: #ffa500;
